--
-- Prosedur
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `PENDAFTARAN_BY_NO_PENDAFTARAN` (IN `noPendaftaran` INT)  BEGIN
select 
	SUM(CASE 
        WHEN poli = "UMUM" AND is_done = 1 THEN 2
		WHEN poli = "UMUM" AND is_done = 0 THEN 1
        ELSE 0 END) AS umum,
    SUM(CASE 
        WHEN poli = "GIGI" AND is_done = 1 THEN 2
		WHEN poli = "GIGI" AND is_done = 0 THEN 1
        ELSE 0 END) AS gigi,
    SUM(CASE 
        WHEN poli = "LABORATORIUM" AND is_done = 1 THEN 2
		WHEN poli = "LABORATORIUM" AND is_done = 0 THEN 1
        ELSE 0 END) AS laboratorium
FROM db_pendaftaran_tindakan
inner join db_dokter on db_dokter.no = db_pendaftaran_tindakan.id_dokter
where db_pendaftaran_tindakan.id_pendaftaran = noPendaftaran
GROUP BY db_pendaftaran_tindakan.id_pendaftaran
;
END$$

